const SegundoCompo = () => {

    let articulos = [
            "Cuadros",
            "cadenas",
            "frenos",

    ];

    return<div>
        <h1>Segundo Compononte   </h1>
        <div>
        <ul>

            <li>Cuadros BTM</li>
            <li>Frenos Shimano</li>
            <li>Cadena Santa Cruz</li>
            <li>Treck Ciclismo</li>
            <li>Más</li>
        </ul>
        <h2>Artículos</h2>
        <ul>
            {
                articulos.map(articulos => {
                    return (<li>
                        {
                            articulos
                        }
                    </li>)
                })
            }
        </ul>
        </div>

    </div>

}

export default SegundoCompo;
